import {FaLinkedin} from "react-icons/fa";

function Bio(props) {

    const {} = props;

    return (
        <Container>
            <ContentContainer>
                <BioContainer>
                    <div className="text">
                        <h2>About Me</h2>
                        <p>Passionate designer & developer who loves simplicity in things and crafts beautiful user interfaces with love.</p>
                        <div className="links">
                            <a href="">
                                <FaFacebookSquare/>
                            </a>
                            <a href="">
                                <FaLinkedin/>
                            </a>
                            <a href="">
                                <FaGithub/>
                            </a>
                        </div>
                    </div>
                    <div className="photo">
                        <img src="https://www.beingeorge.com/justin/assets/images/avatar.jpg" alt=""/>
                    </div>

                </BioContainer>
            </ContentContainer>
        </Container>
    )

}

const Container = styled.div`

`;

const BioContainer = styled.div`
  max-width: 950px;
  background: #ffffff;
  border-radius: 6px;
  padding: 50px;
  display: flex;
  margin: auto;

`;

export default Bio;
